import React from "react";
import "./Modal.css";

const Modal = props => {
  return (
    <div
      className="Modal"
      style={{ transform: props.show ? "translateY(0)" : "transalteY(-100vh)" }}
    >
      {props.children}
    </div>
  );
};

export default Modal;
